import React from "react";

export const Top = () => {
    return (
        <div
            className="top"
            style={{
             position: 'fixed',
             top: 0,
             left: 0,
             zIndex: 100,
                padding: 0,
             margin: 0,
            }}
        >
            <h1>CJ</h1>
        </div>
    )
}
